import React, { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom"; // Import useNavigate

const Cart = () => {
  const [cartItems, setCartItems] = useState([]);
  const [totalPrice, setTotalPrice] = useState(0);
  const navigate = useNavigate(); // Initialize navigation

  useEffect(() => {
    fetchCart();
  }, []);

  const fetchCart = async () => {
    try {
      const response = await axios.get('http://localhost:8000/medical_store_app/cart/');
      if (response.data.cart_items.length === 0) {
        console.log('Cart is empty.');
      } else {
        console.log('Cart items:', response.data.cart_items);
      }
      setCartItems(response.data.cart_items); // Update the cart state
      setTotalPrice(response.data.total_price);
    } catch (error) {
      console.error('Error fetching cart items:', error);
    }
  };

  const handleAddToCart = async (productId) => {
    try {
      await axios.post(`/medical_store_app/cart/add/${productId}/`);
      fetchCart();
    } catch (error) {
      console.error("Error adding item to cart:", error);
    }
  };

  const handleUpdateCart = async (cartId, quantity) => {
    if (quantity <= 0) {
      handleRemoveFromCart(cartId);
      return;
    }
    try {
      await axios.post(`/medical_store_app/cart/update/${cartId}/`, { quantity });
      fetchCart();
    } catch (error) {
      console.error("Error updating cart item:", error);
    }
  };

  const handleRemoveFromCart = async (cartId) => {
    if (!cartId) {
      console.error("Cart ID is undefined!");
      return;
    }
  
    try {
      await axios.delete(`/medical_store_app/cart/remove/${cartId}/`);
      fetchCart(); // Refresh the cart after removal
    } catch (error) {
      console.error("Error removing cart item:", error);
    }
  };
  
  const handleProceedToCheckout = () => {
    // Navigate to the checkout page
    navigate("/checkout");
  };

            return (
              <div style={styles.container}>
                <h1 style={styles.heading}>Your Cart</h1>
                <table style={styles.table}>
                  <thead>
                    <tr>
                      <th style={styles.tableHeader}>Medicine</th>
                      <th style={styles.tableHeader}>Quantity</th>
                      <th style={styles.tableHeader}>Actions</th>
                    </tr>
                  </thead>
                  <tbody>
                  {cartItems.map((item, index) => (
                  <tr key={index}>
                    <td>{item.medicine}</td>
                    <td>
                      <input
                        type="number"
                        value={item.quantity}
                        onChange={(e) =>
                          handleUpdateCart(item.cart_id, parseInt(e.target.value))
                        }
                      />
                    </td>
                    <td>
                      <button
                        onClick={() => handleRemoveFromCart(item.cart_id)} // Pass the correct cart_id
                      >
                        Remove
                      </button>
                    </td>
                  </tr>
                ))}

        </tbody>
      </table>
      <h3 style={styles.total}>Total: ${totalPrice}</h3>
      <div style={styles.paymentContainer}>
        <button
          style={styles.paymentButton}
          onClick={handleProceedToCheckout}
        >
          Proceed to Payment
        </button>
      </div>
    </div>
  );
};

const styles = {
  container: {
    padding: "46px",
    fontFamily: "Arial, sans-serif",
  },
  heading: {
    textAlign: "center",
    fontSize: "2rem",
    marginBottom: "20px",
  },
  table: {
    width: "100%",
    borderCollapse: "collapse",
    marginBottom: "20px",
  },
  tableHeader: {
    backgroundColor: "#f4f4f4",
    padding: "10px",
    textAlign: "left",
    fontWeight: "bold",
  },
  tableData: {
    padding: "10px",
    borderBottom: "1px solid #ddd",
  },
  input: {
    padding: "5px",
    width: "50px",
    textAlign: "center",
    borderRadius: "5px",
    border: "1px solid #ddd",
  },
  button: {
    backgroundColor: "#ff4d4d",
    color: "white",
    border: "none",
    padding: "5px 10px",
    borderRadius: "5px",
    cursor: "pointer",
  },
  total: {
    fontSize: "1.5rem",
    textAlign: "right",
    marginTop: "20px",
    fontWeight: "bold",
  },
  paymentContainer: {
    textAlign: "right",
    marginTop: "20px",
  },
  paymentButton: {
    backgroundColor: "#4CAF50",
    color: "white",
    border: "none",
    padding: "10px 20px",
    fontSize: "1rem",
    borderRadius: "5px",
    cursor: "pointer",
  },
};

export default Cart;
